import React from 'react';
import '../../../../styles/HomepageContentCreativeList.css'

export default () => {
    return(
        <>
        <div className="creative_list">
            <h5>Creative List</h5>
            <hr></hr>
            <div>
                <button>Creative full-scale display</button>
                <button>LP batch check</button>
            </div>
        </div>
        </>
    )
}
